import React from "react";
import PicContainer from "../PicContainer/PicContainer";
import "./RestaurantSlide.scss";
import claroImg from "../../assets/restaurants/claro/claro@2x.png";
//import luminaImg from "../../assets/restaurants/lumina/lumina.png";
import kabKemImg from "../../assets/restaurants/kab-kem/kab-kem@2x.png";
import messaImg from "../../assets/restaurants/messa/messa@2x.png";
import { type } from "os";

const RESTAURANTS = [
  {
    name: "Claro",
    chefName: "Ran Shmueli",
    pic: claroImg,
  },
  //   {
  //     name: "Lumina",
  //     chefName: "Meir Adoni",
  //     pic: luminaImg,
  //   },
  {
    name: "Kab Kem",
    chefName: "Yariv Malili",
    pic: kabKemImg,
  },
  {
    name: "Messa",
    chefName: "Aviv Moshe",
    pic: messaImg,
  },
];

type Props = {
  rests: [];
};

const RestaurantSlide: React.FC<Props> = ({ rests }) => {
  return (
    <div className="rest-slide-container">
      <div className="rest-slide-title">
        THE POPULAR RESTAURANTS IN EPICURE :
      </div>
      <div className="rest-slide">
        {RESTAURANTS.map((rest, index) => {
          return (
            <PicContainer
              key={index}
              type="rest-carusel"
              pic={rest.pic}
              title={rest.name}
              text={rest.chefName}
              icons={[]}
              price=""
              id={index}
            />
          );
        })}
      </div>
    </div>
  );
};

export default RestaurantSlide;
